import React from 'react';
import './Suggestions.css';

const Suggestions = () => {
  return (
    <div className="suggestions">
      <h3>Suggestions for Improvement</h3>
      <ul>
        {/* Populate suggestions dynamically */}
        <li>Suggestion 1</li>
        <li>Suggestion 2</li>
        <li>Suggestion 3</li>
      </ul>
    </div>
  );
};

export default Suggestions;
